import React from 'react';
import valuesIcon from './icons/values-icon.png';

function HomePage() {
  const containerStyle = {
    textAlign: 'center',
  };

  return (
    <div style={containerStyle}>
      <h2>Welcome to the Home Page</h2>
      <img src={valuesIcon} alt="Values Icon" />
    </div>
  );
}

export default HomePage;
